root.render(
  <React.StrictMode>
    <HelloWorld />
    <TestButton />
  </React.StrictMode>
);

function HelloWorld(){
  return <h1 className = "greeting">Hello world</h1>
}

function TestButton(){
  return <button>This is a button!</button>
}

